CREATE TABLE `tricks` (
  `id` int(11) NOT NULL,
  `id_category_id` int(11) NOT NULL,
  `name` varchar(50) NOT NULL,
  `description` longtext NOT NULL,
  `slug` varchar(255) DEFAULT NULL,
  `created_at` datetime NOT NULL COMMENT '(DC2Type:datetime_immutable)',
  `updated_at` datetime NOT NULL COMMENT '(DC2Type:datetime_immutable)'
) ;

--
-- Dumping data for table `tricks`
--

INSERT INTO `tricks` (`id`, `id_category_id`, `name`, `description`, `slug`, `created_at`, `updated_at`) VALUES
(1, 1, 'ollie', 'Le Ollie, c\'est la base du freestyle en snowboard, c\'est une impulsion  avec déformation de la planche qui permet de faire un saut, comme un ollie de skate, mais en beaucoup plus facile car les deux pieds sont attachés sur la board. C\'est donc un petit ou grand saut, le Ollie peut servir a amorcer d\'autres Tricks.', 'ollie', '2022-12-06 12:35:34', '2023-05-26 11:17:04'),
(3, 1, 'Le Press', 'Un press est l’action d’incliner votre poids sur la spatule (nosepress) ou sur le talon (tailpress) de la planche, de manière à faire décoller l’autre extrémité de la planche. Cette figure est vraiment fun et peut être réalisée n’importe où en montagne.', 'le-press', '2022-12-06 12:35:34', '2023-05-18 11:09:54'),
(7, 2, 'Tail Grab', 'saisie de la partie arrière de la planche, avec la main arrière', 'Tail-Grab', '2022-12-08 09:57:31', '2022-12-20 16:02:16'),
(8, 2, 'Nose Grab', 'Saisie de la partie avant de la planche, avec la main avant', 'Nose-Grab', '2022-12-08 09:58:44', '2022-12-20 16:02:28'),
(9, 2, 'Indy', 'Saisie de la carre frontside de la planche, entre les deux pieds, avec la main arrière.', 'Indy', '2022-12-08 09:59:38', '2023-01-01 17:21:36'),
(10, 3, '360 Frontside', 'Tours complet en l\'air avec un grab de l\'avant de la planche ! Un trick bien sympa qui peut être fait avec beaucoup de style !', '360-Frontside', '2022-12-08 12:14:45', '2023-01-03 13:30:39'),
(12, 3, '180 Back', 'Pour les néophytes, le backside 180 ou 180 back est un saut avec un demi tour qui s\'effectue côté pointes de pieds en envoyant les épaules dos à la pente lors de la rotation, ce qui fait qu\'à l’atterrissage on se retrouve en marche arrière. Comme dans toute rotation l’important est la synchronisation entre l’impulsion et la rotation des épaules.', '180-Back', '2022-12-12 10:53:50', '2022-12-20 16:03:54'),
(13, 4, 'Backflip', 'Iconique, le backflip est la figure référence du freestyle. Que ce soit en skate, ski, roller, snowboard ou autres, le backflip est une rotations en arrière.\r\nOn peut y ajouter des rotations ou encore des grabs pour augmenter la difficulté.', 'Backflip', '2022-12-20 16:13:40', '2022-12-23 13:51:01'),
(14, 4, 'Frontflip', 'Comme le backflip mais en avant !', 'Frontflip', '2023-05-05 15:33:58', '2023-05-05 15:33:58'),
(15, 3, '720 Frontside', '2 tours avec un grab de l\'avant de la planche !', '720-Frontside', '2023-05-05 15:37:45', '2023-05-05 15:37:45');

